const styles = StyleSheet.create({
    direita: {
        backgroundColor: 'red' ,
        borderRadius: 8 ,
        right: 30,
    },
    esquerda: {
        backgroundColor: 'red' ,
        borderRadius: 8 ,
        left: 30,
    },
    texto: {
    position:'absolute', width: '81', height: '24', left: '147', top: '44', 
    fontFamily: 'Poppins',
    fontStyle: 'normal',
    fontWeight: 'bold',
    fontSize: '16',
    lineHeight: '24'
    }
});

export default styles
